import React from 'react';
import { motion } from "framer-motion";


function VehicleImg({ 
  selectedVehicle,
  vehicle,
  className, 
  id, 
}) {
  const isSelected = selectedVehicle.id === vehicle.id;
  const imageSrc = vehicle.img;
  const alt = `${vehicle.name} - ${vehicle.model}`;
  return (
    <motion.div
      className={id}
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <img
        className={className}
        id={id}
        src={imageSrc}
        alt={alt}
      />
    </motion.div>
  );
}

export default VehicleImg;
